import React, { PureComponent } from 'react'

export class BuySavePlans extends PureComponent {
  render() {
    return (
      <div class='row g-6 g-xl-9'>
        {/*begin::Col*/}
        <div class='col-md-6 col-xxl-4' style={{ border: '1px solid black' }}>
          {/*begin::Card*/}
          <div class='card'>
            {/*begin::Card body*/}
            <div class='card-body d-flex flex-center flex-column pt-12 p-9'>
              {/*begin::Avatar*/}
              <div class='symbol symbol-65px symbol-circle mb-5'>
                <img src='./media//avatars/150-3.jpg' alt='image' />
                <div class='bg-success position-absolute border border-4 border-white h-15px w-15px rounded-circle translate-middle start-100 top-100 ms-n3 mt-n3'></div>
              </div>
              {/*end::Avatar*/}
              {/*begin::Name*/}
              <a
                href='#'
                class='fs-4 text-gray-800 text-hover-primary fw-bolder mb-0'
              >
                Karina Clark
              </a>
              {/*end::Name*/}
              {/*begin::Position*/}
              <div class='fw-bold text-gray-400 mb-6'>
                Art Director at Novica Co.
              </div>
              {/*end::Position*/}
              {/*begin::Info*/}
              <div class='d-flex flex-center flex-wrap'>
                {/*begin::Stats*/}
                <div class='border border-gray-300 border-dashed rounded min-w-80px py-3 px-4 mx-2 mb-3'>
                  <div class='fs-6 fw-bolder text-gray-700'>$14,560</div>
                  <div class='fw-bold text-gray-400'>Earnings</div>
                </div>
                {/*end::Stats*/}
                {/*begin::Stats*/}
                <div class='border border-gray-300 border-dashed rounded min-w-80px py-3 px-4 mx-2 mb-3'>
                  <div class='fs-6 fw-bolder text-gray-700'>23</div>
                  <div class='fw-bold text-gray-400'>Tasks</div>
                </div>
                {/*end::Stats*/}
                {/*begin::Stats*/}
                <div class='border border-gray-300 border-dashed rounded min-w-80px py-3 px-4 mx-2 mb-3'>
                  <div class='fs-6 fw-bolder text-gray-700'>$236,400</div>
                  <div class='fw-bold text-gray-400'>Sales</div>
                </div>
                {/*end::Stats*/}
              </div>
              {/*end::Info*/}
            </div>
            {/*end::Card body*/}
          </div>
          {/*end::Card*/}
        </div>
        {/*end::Col*/}
        {/*begin::Col*/}
        <div class='col-md-6 col-xxl-4'>
          {/*begin::Card*/}
          <div class='card'>
            {/*begin::Card body*/}
            <div class='card-body d-flex flex-center flex-column pt-12 p-9'>
              {/*begin::Avatar*/}
              <div class='symbol symbol-65px symbol-circle mb-5'>
                <span class='symbol-label fs-2x fw-bold text-primary bg-light-primary'>
                  S
                </span>
                <div class='bg-success position-absolute border border-4 border-white h-15px w-15px rounded-circle translate-middle start-100 top-100 ms-n3 mt-n3'></div>
              </div>
              {/*end::Avatar*/}
              {/*begin::Name*/}
              <a
                href='#'
                class='fs-4 text-gray-800 text-hover-primary fw-bolder mb-0'
              >
                Sean Bean
              </a>
              {/*end::Name*/}
              {/*begin::Position*/}
              <div class='fw-bold text-gray-400 mb-6'>
                Developer at Loop Inc
              </div>
              {/*end::Position*/}
              {/*begin::Info*/}
              <div class='d-flex flex-center flex-wrap'>
                {/*begin::Stats*/}
                <div class='border border-gray-300 border-dashed rounded min-w-80px py-3 px-4 mx-2 mb-3'>
                  <div class='fs-6 fw-bolder text-gray-700'>$14,560</div>
                  <div class='fw-bold text-gray-400'>Earnings</div>
                </div>
                {/*end::Stats*/}
                {/*begin::Stats*/}
                <div class='border border-gray-300 border-dashed rounded min-w-80px py-3 px-4 mx-2 mb-3'>
                  <div class='fs-6 fw-bolder text-gray-700'>23</div>
                  <div class='fw-bold text-gray-400'>Tasks</div>
                </div>
                {/*end::Stats*/}
                {/*begin::Stats*/}
                <div class='border border-gray-300 border-dashed rounded min-w-80px py-3 px-4 mx-2 mb-3'>
                  <div class='fs-6 fw-bolder text-gray-700'>$236,400</div>
                  <div class='fw-bold text-gray-400'>Sales</div>
                </div>
                {/*end::Stats*/}
              </div>
              {/*end::Info*/}
            </div>
            {/*end::Card body*/}
          </div>
          {/*end::Card*/}
        </div>
        {/*end::Col*/}
        {/*begin::Col*/}
        <div class='col-md-6 col-xxl-4'>
          {/*begin::Card*/}
          <div class='card'>
            {/*begin::Card body*/}
            <div class='card-body d-flex flex-center flex-column pt-12 p-9'>
              {/*begin::Avatar*/}
              <div class='symbol symbol-65px symbol-circle mb-5'>
                <img src='./media//avatars/150-2.jpg' alt='image' />
              </div>
              {/*end::Avatar*/}
              {/*begin::Name*/}
              <a
                href='#'
                class='fs-4 text-gray-800 text-hover-primary fw-bolder mb-0'
              >
                Alan Johnson
              </a>
              {/*end::Name*/}
              {/*begin::Position*/}
              <div class='fw-bold text-gray-400 mb-6'>
                Web Designer at Nextop Ltd.
              </div>
              {/*end::Position*/}
              {/*begin::Info*/}
              <div class='d-flex flex-center flex-wrap'>
                {/*begin::Stats*/}
                <div class='border border-gray-300 border-dashed rounded min-w-80px py-3 px-4 mx-2 mb-3'>
                  <div class='fs-6 fw-bolder text-gray-700'>$14,560</div>
                  <div class='fw-bold text-gray-400'>Earnings</div>
                </div>
                {/*end::Stats*/}
                {/*begin::Stats*/}
                <div class='border border-gray-300 border-dashed rounded min-w-80px py-3 px-4 mx-2 mb-3'>
                  <div class='fs-6 fw-bolder text-gray-700'>23</div>
                  <div class='fw-bold text-gray-400'>Tasks</div>
                </div>
                {/*end::Stats*/}
                {/*begin::Stats*/}
                <div class='border border-gray-300 border-dashed rounded min-w-80px py-3 px-4 mx-2 mb-3'>
                  <div class='fs-6 fw-bolder text-gray-700'>$236,400</div>
                  <div class='fw-bold text-gray-400'>Sales</div>
                </div>
                {/*end::Stats*/}
              </div>
              {/*end::Info*/}
            </div>
            {/*end::Card body*/}
          </div>
          {/*end::Card*/}
        </div>
        {/*end::Col*/}
        {/*begin::Col*/}
        <div class='col-md-6 col-xxl-4'>
          {/*begin::Card*/}
          <div class='card'>
            {/*begin::Card body*/}
            <div class='card-body d-flex flex-center flex-column pt-12 p-9'>
              {/*begin::Avatar*/}
              <div class='symbol symbol-65px symbol-circle mb-5'>
